r un candidat d''être capable de converser correctement dans la langue choisie pour espérer obtenir des points supplémentaires.<br/>L''épreuve devient obligatoire dès lors que vous y serez inscrit(e) sous peine d''élimination.<br /><strong>Vous avez jusqu''à la clôture des inscriptions pour modifier ou supprimer le choix de la LV2</strong>',NULL,NULL,1,'1','2022-05-31 17:28:04','2022-05-31 17:28:04',NULL,NULL), (68,28,NULL,'Prenez soin de bien compléter chaque rubrique. Chaque diplôme, années d’études post bac et chaque expérience viendront valoriser votre candidature. Votre CV peut être complété en 1 ou plusieurs fois, mais il doit être validé avant le {dateFinCV}.',NULL,NULL,1,'1','2022-05-31 17:28:04','2022-05-31 17:28:04',NULL,NULL), (69,29,NULL,'Vous ne souhaitez plus intégrer Skema ?',NULL,NULL,1,'1','2022-05-31 17:28:04','2022-05-31 17:28:04',NULL,NULL), (70,29,NULL,'Démissionner',NULL,NULL,1,'1','2022-05-31 17:28:04','2022-05-31 17:28:04',NULL,NULL), (71,29,NULL,'Confirmez-vous votre démission ?',NULL,NULL,1,'1','2022-05-31 17:28:04','2022-05-31 17:28:04',NULL,NULL), (72,29,NULL,'Vous avez démissionné, vous n’êtes plus candidat au concours Grande École Skema. Vous allez être déconnecté de l’espace candidat.',NULL,NULL,1,'1','2022-05-31 17:28:04','2022-05-31 17:28:04','RESIGNATION_LABEL_MESSAGE',NULL), (73,30,'Vous avez reçu un nouveau message','Bonjour, vous avez reçu un nouveau message de la part du service concours Skema. Merci de vous connecter à votre espace pour en prendre connaissance.',NULL,NULL,1,'1','2022-05-31 17:28:04','2022-05-31 17:28:04','NOTIFICATION_MESSAGE_STUDENT',NULL)");
